import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, Typography, Button, Box, Dialog, DialogTitle, DialogContent, DialogActions, List, ListItem, ListItemText } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import LocalOfferIcon from '@mui/icons-material/LocalOffer';
import { admin } from '../../services/api'; // Assuming you have an API service

const Navbar = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');
  const role = localStorage.getItem('role');

  const [openNewCoupons, setOpenNewCoupons] = useState(false);
  const [openAssignedCoupons, setOpenAssignedCoupons] = useState(false);
  const [newCoupons, setNewCoupons] = useState([]);
  const [assignedCoupons, setAssignedCoupons] = useState([]);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('role');
    navigate('/');
  };

  const fetchNewCoupons = async () => {
    try {
      const response = await admin.getNewCoupons();
      setNewCoupons(response.data);
      setOpenNewCoupons(true);
    } catch (err) {
      console.error('Failed to fetch new coupons');
    }
  };

  const fetchAssignedCoupons = async () => {
    try {
      const response = await admin.getAssignedCoupons();
      setAssignedCoupons(response.data);
      setOpenAssignedCoupons(true);
    } catch (err) {
      console.error('Failed to fetch assigned coupons');
    }
  };

  return (
    <>
      <AppBar position="static" sx={{ marginBottom: 4 }}>
        <Toolbar>
          <LocalOfferIcon sx={{ mr: 2 }} />
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            CouponHub
          </Typography>
          <Box>
            {role === 'ROLE_ADMIN' && (
              <>
                <Button color="inherit" onClick={fetchNewCoupons}>
                  New Coupons
                </Button>
                <Button color="inherit" onClick={fetchAssignedCoupons}>
                  Assigned Coupons
                </Button>
              </>
            )}
            {token ? (
              <Button color="inherit" onClick={handleLogout}>
                Logout
              </Button>
            ) : (
              <>
                <Button color="inherit" onClick={() => navigate('/login')}>
                  Login
                </Button>
                <Button color="inherit" onClick={() => navigate('/register')}>
                  Register
                </Button>
              </>
            )}
          </Box>
        </Toolbar>
      </AppBar>

      {/* New Coupons Modal */}
      <Dialog open={openNewCoupons} onClose={() => setOpenNewCoupons(false)} fullWidth maxWidth="sm">
        <DialogTitle>New Coupons</DialogTitle>
        <DialogContent>
          <List>
            {newCoupons.length > 0 ? (
              newCoupons.map((coupon) => (
                <ListItem key={ coupon.id}>
                  <ListItemText primary={coupon.code} secondary={`Discount: ${coupon.discountPercentage}%`} />
                </ListItem>
              ))
            ) : (
              <Typography>No new coupons available.</Typography>
            )}
          </List>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpenNewCoupons(false)}>Close</Button>
        </DialogActions>
      </Dialog>

      {/* Assigned Coupons Modal */}
      <Dialog open={openAssignedCoupons} onClose={() => setOpenAssignedCoupons(false)} fullWidth maxWidth="sm">
        <DialogTitle>Assigned Coupons</DialogTitle>
        <DialogContent>
          <List>
            {assignedCoupons.length > 0 ? (
              assignedCoupons.map((coupon) => (
                <ListItem key={coupon.id}>
                  <ListItemText primary={coupon.code} secondary={`Assigned to: ${coupon.userEmail}`} />
                </ListItem>
              ))
            ) : (
              <Typography>No assigned coupons available.</Typography>
            )}
          </List>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpenAssignedCoupons(false)}>Close</Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default Navbar;
